    );
  }
}

class LoginComponent extends Component {
  render() {
    return <div>
        <label htmlFor="username">Username: </label>
        <input type="text" name="username" id="username" />

        <label htmlFor="password"></label>
    </div>;
  }
}

export default GymProgressApp;
